        return (
            <WriterWrapper>
                <WriterItem>
                    <img className="header-pic" src="http://upload.jianshu.io/users/upload_avatars/677687/c84b99723362.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/96/h/96/format/webp"/>
                    <WriterInfo>
                        <span className="name">灰土豆</span>
                        <span className="desc">写了339.2k字 · 1.8k喜欢</span>
                    </WriterInfo>
                    <i className="follow">+关注</i>
                </WriterItem>
                <WriterItem>
                    <img className="header-pic" src="http://upload.jianshu.io/users/upload_avatars/677687/c84b99723362.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/96/h/96/format/webp"/>
                    <WriterInfo>
                        <span className="name">灰土豆</span>
                        <span className="desc">写了339.2k字 · 1.8k喜欢</span>
                    </WriterInfo>
                    <i className="follow">+关注</i>
                </WriterItem>
            </WriterWrapper>
        )
    }
}

export default Writer;
